import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="sign-up">
        <div className="header"></div>
        <div className="bottom">
          <button className>ХАДГАЛАХ</button>
        </div>
      </div>
    </div>
  );
}

export default App;
